declare module "*.jpg" {
    const content: Jpg;
    export default content;
}
declare module "*.jpeg" {
    const content: Jpeg;
    export default content;
}
declare module "*.png" {
    const content: Png;
    export default content;
}
declare module "*.svg" {
    const content: Svg;
    export default content;
}
declare module "*.svg?sprite" {
    const content: SvgSprite;
    export default content;
}
